import React, { Component } from "react";
import "./Home.less";
import {Menu,Icon,Button} from "antd";
import logo from '../../../assets/images/1556898894199.jpg'
const { SubMenu } = Menu;

class Home extends Component {
  state = {
    collapsed: false,
  };
  toggleCollapsed = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };
  componentDidMount = () => {};

  render() {
    return (
      <div className='home'>
      <div className='home-left' >
      <Menu
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
        theme="dark"
        style={{height:"100vh"}}
        inlineCollapsed={this.state.collapsed}
      >
        <div className='home-left-logo'>
          <image className='home-left-logo-img' src={logo}></image>
        </div>
        <Menu.Item key="1">
          <Icon type="pie-chart" />
          <span>Option 1</span>
        </Menu.Item>
        <Menu.Item key="2">
          <Icon type="desktop" />
          <span>Option 2</span>
        </Menu.Item>

      </Menu>
    </div>
    <div className='home-right'>
      content
    </div>
    </div>
    );
  }
}

export default Home;
